import{_ as e,o as a,c as r,O as i}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 28.2-1415 Judicial review.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/28.2-1415.md","filePath":"vacode/28.2-1415.md"}'),t={name:"vacode/28.2-1415.md"},o=i('<h1 id="§-28-2-1415-judicial-review" tabindex="-1">§ 28.2-1415 Judicial review. <a class="header-anchor" href="#§-28-2-1415-judicial-review" aria-label="Permalink to &quot;§ 28.2-1415 Judicial review.&quot;">​</a></h1><p>An appeal from any Commission decision granting or denying a permit or from any Commission decision on the review of or appeal from a board decision may be taken by the applicant, any of the freeholders specified in subsection A of § <a href="http://law.lis.virginia.gov/vacode/28.2-1411/" target="_blank" rel="noreferrer">28.2-1411</a>, or by the county, city or town where the dunes or beaches are located. Judicial review shall be pursuant to the provisions of the Administrative Process Act (§ <a href="http://law.lis.virginia.gov/vacode/2.2-4000/" target="_blank" rel="noreferrer">2.2-4000</a> et seq.).</p><p>1992, c. 836; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0112" target="_blank" rel="noreferrer">112</a>.</p>',3),n=[o];function c(s,l,d,_,p,h){return a(),r("div",null,n)}const m=e(t,[["render",c]]);export{v as __pageData,m as default};
